import React from 'react';
import './UserDashboard.css';

const UserDashboard = () => {
    const handleLogout = () => {
        // Logout logic here (e.g., clear session, redirect to login)
        console.log('Logging out...');
    };

    return (
        <div className="user-main-content">
            <div className="user-header">
                <h1>Welcome, User</h1>
                <button className="user-logout-button" onClick={handleLogout}>Logout</button>
            </div>

            <div className="user-section">
                <h2>Self-Service</h2>
                <button className="user-button">Checkout Resources</button>
                <button className="user-button">Return Items</button>
            </div>

            <div className="user-section">
                <h2>Renewals and Reservations</h2>
                <button className="user-button">Renew My Books</button>
                <button className="user-button">Reserve Items</button>
            </div>
        </div>
    );
};

export default UserDashboard;
